import React from "react";
import Comment from "./Comment";
import Todo from "./Todo";

const TodoList = ({ todos }) => {
  return (
    <>
      {todos.map((todo) => {
        <div>{todo.title}</div>;
      })}

      <Todo />
      <Comment />
    </>
  );
};

export default TodoList;
